import React, { Component } from "react";

const Details = ({ data }) => {
  console.log(data);
  return (
    <div className="border bg-light p-3 ">
      <div className="row" style={{ justifyContent: "center" }}>
        {data.map((year) => (
          <div class="card m-1">
            <img
              class="card-img-top img-thumbnail"
              src={year.links.mission_patch_small}
              alt="Card image cap"
            ></img>
            <div class="card-body">
              <h5 class="card-title text-primary">{`${year.mission_name}#${year.flight_number}`}</h5>
              <h5>Mission ids</h5>
              <ul class="list-group list-group-flush">
                {year.map((item) => {
                  <li class="list-group-item">{item}</li>;
                })}
              </ul>

              <a href="#" class="btn btn-primary">
                Go somewhere
              </a>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Details;
